import React from 'react';
import styled from 'styled-components';
import { motion } from 'framer-motion';

const LiteratureContainer = styled.div`
  padding: 40px;
  background: linear-gradient(135deg, #f8fafc 0%, #e2e8f0 100%);
`;

const SectionTitle = styled.h2`
  font-family: 'Merriweather', serif;
  font-size: 2.2rem;
  color: #1e3a8a;
  margin-bottom: 15px;
  text-align: center;
`;

const SectionSubtitle = styled.p`
  font-size: 1.1rem;
  color: #64748b;
  text-align: center;
  margin-bottom: 40px;
  line-height: 1.6;
`;

const LiteratureSection = styled(motion.div)`
  background: white;
  border-radius: 20px;
  padding: 35px;
  margin-bottom: 30px;
  box-shadow: 0 10px 30px rgba(0,0,0,0.1);
  border: 1px solid #e2e8f0;
`;

const SectionHeader = styled.h3`
  font-family: 'Merriweather', serif;
  font-size: 1.6rem;
  color: #1e3a8a;
  margin-bottom: 25px;
  display: flex;
  align-items: center;
  gap: 12px;
`;

const StudyCard = styled(motion.div)`
  background: ${props => {
    switch(props.relevance) {
      case 'high': return 'linear-gradient(135deg, #d1fae5, #a7f3d0)';
      case 'medium': return 'linear-gradient(135deg, #dbeafe, #bfdbfe)';
      case 'supporting': return 'linear-gradient(135deg, #fef3c7, #fde68a)';
      default: return 'linear-gradient(135deg, #f3f4f6, #e5e7eb)';
    }
  }};
  padding: 25px;
  border-radius: 15px;
  border-left: 4px solid ${props => {
    switch(props.relevance) {
      case 'high': return '#10b981';
      case 'medium': return '#3b82f6';
      case 'supporting': return '#f59e0b';
      default: return '#6b7280';
    }
  }};
  margin-bottom: 25px;
`;

const StudyTitle = styled.h4`
  font-size: 1.1rem;
  font-weight: 600;
  color: #1f2937;
  margin-bottom: 8px;
`;

const StudyAuthors = styled.div`
  font-size: 0.9rem;
  color: #6b7280;
  margin-bottom: 8px;
  font-style: italic;
`;

const StudyJournal = styled.div`
  font-size: 0.85rem;
  color: #9ca3af;
  margin-bottom: 15px;
  font-weight: 500;
`;

const StudyFindings = styled.div`
  font-size: 0.95rem;
  line-height: 1.6;
  color: #374151;
  margin-bottom: 15px;
`;

const RelevanceTag = styled.span`
  background: ${props => {
    switch(props.relevance) {
      case 'high': return '#10b981';
      case 'medium': return '#3b82f6';
      case 'supporting': return '#f59e0b';
      default: return '#6b7280';
    }
  }};
  color: white;
  padding: 4px 10px;
  border-radius: 10px;
  font-size: 0.75rem;
  font-weight: 600;
  text-transform: uppercase;
`;

const GapAnalysis = styled.div`
  background: linear-gradient(135deg, #fef2f2, #fecaca);
  padding: 25px;
  border-radius: 15px;
  border-left: 4px solid #ef4444;
  margin: 25px 0;
`;

const GapTitle = styled.h4`
  font-size: 1.1rem;
  font-weight: 600;
  color: #991b1b;
  margin-bottom: 12px;
`;

const GapText = styled.div`
  font-size: 0.95rem;
  line-height: 1.6;
  color: #991b1b;
`;

const ThemeSection = styled.div`
  margin: 30px 0;
`;

const ThemeTitle = styled.h4`
  font-size: 1.3rem;
  color: #1e3a8a;
  margin-bottom: 20px;
  padding-bottom: 8px;
  border-bottom: 2px solid #e2e8f0;
`;

const ComparisonTable = styled.div`
  background: #f8fafc;
  border-radius: 12px;
  padding: 25px;
  border: 1px solid #e2e8f0;
  margin: 25px 0;
`;

const TableRow = styled.div`
  display: grid;
  grid-template-columns: 2fr 1fr 1fr 2fr;
  gap: 15px;
  padding: 12px 0;
  border-bottom: 1px solid #e2e8f0;
  font-size: 0.9rem;

  &:first-child {
    font-weight: 600;
    color: #374151;
    background: #e2e8f0;
    padding: 15px 10px;
    border-radius: 8px;
    margin-bottom: 10px;
  }

  &:last-child {
    border-bottom: none;
  }
`;

const LiteratureContext = () => {
  const keyStudies = [
    {
      relevance: 'high',
      title: 'Medicaid Provider Participation: The Role of Reimbursement Rates and Administrative Burden',
      authors: 'Polsky et al.',
      journal: 'Health Affairs, 2015',
      findings: 'Found that 69% of physicians accept new Medicaid patients, with significant variation by specialty. Administrative burden emerged as a key barrier beyond reimbursement rates.',
      comparison: 'Our study extends this by examining longitudinal participation changes rather than cross-sectional acceptance rates.'
    },
    {
      relevance: 'high',
      title: 'Geographic Variations in Primary Care Provider Participation in Medicaid',
      authors: 'Decker, S.',
      journal: 'Journal of Health Economics, 2018',
      findings: 'Documented substantial geographic variation in Medicaid participation, with rural areas showing consistently lower rates across all provider types.',
      comparison: 'Confirms our rural findings but focuses on static participation rather than dynamic changes over time.'
    },
    {
      relevance: 'medium',
      title: 'Community Health Centers and Medicaid Provider Networks: A National Analysis',
      authors: 'Paradise & Rosenbaum',
      journal: 'Health Affairs, 2017',
      findings: 'CHCs served 28 million patients, with 62% on Medicaid. Demonstrated superior access and continuity metrics compared to private practices.',
      comparison: 'Supports our finding of CHC stability advantage, though previous work did not quantify volatility patterns.'
    },
    {
      relevance: 'medium',
      title: 'The Impact of Medicaid Expansion on Provider Networks and Access',
      authors: 'Sommers et al.',
      journal: 'NEJM, 2019',
      findings: 'Medicaid expansion led to increased provider participation in expansion states, with particular improvements in mental health and specialty care.',
      comparison: 'Aligns with our expansion state findings but examines different time frame and does not address participation volatility.'
    },
    {
      relevance: 'supporting',
      title: 'Provider Payment Rates and Medicaid Enrollment Changes',
      authors: 'Zuckerman & Goin',
      journal: 'Health Services Research, 2012',
      findings: 'Temporary federal payment increases (2013-2014) led to modest improvements in physician willingness to see Medicaid patients.',
      comparison: 'Provides context for payment policy recommendations, though examines short-term experimental increases.'
    }
  ];

  return (
    <LiteratureContainer>
      <SectionTitle>Literature Context & Prior Research</SectionTitle>
      <SectionSubtitle>
        Positioning current findings within the broader body of research on Medicaid provider 
        participation and healthcare access
      </SectionSubtitle>

      <LiteratureSection
        initial={{ opacity: 0, y: 50 }}
        animate={{ opacity: 1, y: 0 }}
        transition={{ duration: 0.6, delay: 0.1 }}
      >
        <SectionHeader>üìö Key Studies & Findings</SectionHeader>

        {keyStudies.map((study, index) => (
          <StudyCard
            key={index}
            relevance={study.relevance}
            initial={{ opacity: 0, x: -30 }}
            animate={{ opacity: 1, x: 0 }}
            transition={{ duration: 0.5, delay: 0.1 + index * 0.1 }}
          >
            <div style={{ display: 'flex', justifyContent: 'space-between', alignItems: 'flex-start', marginBottom: '15px' }}>
              <div style={{ flex: 1 }}>
                <StudyTitle>{study.title}</StudyTitle>
                <StudyAuthors>{study.authors}</StudyAuthors>
                <StudyJournal>{study.journal}</StudyJournal>
              </div>
              <RelevanceTag relevance={study.relevance}>
                {study.relevance} Relevance
              </RelevanceTag>
            </div>

            <StudyFindings>
              <strong>Key Findings:</strong> {study.findings}
            </StudyFindings>

            <div style={{ fontSize: '0.9rem', color: '#6b7280', fontStyle: 'italic' }}>
              <strong>Comparison to Our Study:</strong> {study.comparison}
            </div>
          </StudyCard>
        ))}
      </LiteratureSection>

      <LiteratureSection
        initial={{ opacity: 0, y: 50 }}
        animate={{ opacity: 1, y: 0 }}
        transition={{ duration: 0.6, delay: 0.2 }}
      >
        <SectionHeader>üîç Comparative Analysis</SectionHeader>

        <ComparisonTable>
          <TableRow>
            <span>Study Focus</span>
            <span>Sample Size</span>
            <span>Time Period</span>
            <span>Key Innovation</span>
          </TableRow>

          <TableRow>
            <span><strong>Current Study</strong> - Longitudinal participation changes</span>
            <span>220,665</span>
            <span>2016-2019</span>
            <span>Dynamic volatility analysis</span>
          </TableRow>

          <TableRow>
            <span><strong>Polsky et al.</strong> - Cross-sectional acceptance rates</span>
            <span>1,400</span>
            <span>2013</span>
            <span>Administrative burden focus</span>
          </TableRow>

          <TableRow>
            <span><strong>Decker</strong> - Geographic participation patterns</span>
            <span>45,000</span>
            <span>2011-2016</span>
            <span>Rural-urban disparities</span>
          </TableRow>

          <TableRow>
            <span><strong>Sommers et al.</strong> - Expansion impact assessment</span>
            <span>Mixed methods</span>
            <span>2014-2017</span>
            <span>Policy evaluation focus</span>
          </TableRow>
        </ComparisonTable>

        <ThemeSection>
          <ThemeTitle>Convergent Themes in Literature</ThemeTitle>

          <div style={{ display: 'grid', gridTemplateColumns: 'repeat(auto-fit, minmax(300px, 1fr))', gap: '20px' }}>
            <div style={{ background: '#f0f9ff', padding: '20px', borderRadius: '12px', border: '1px solid #e0f2fe' }}>
              <h4 style={{ color: '#0c4a6e', marginBottom: '10px' }}>Payment Inadequacy</h4>
              <p style={{ fontSize: '0.9rem', color: '#0c4a6e', margin: 0, lineHeight: 1.5 }}>
                Consistent finding across studies that low Medicaid reimbursement rates relative to 
                Medicare and private insurance contribute to participation challenges.
              </p>
            </div>

            <div style={{ background: '#f0fdf4', padding: '20px', borderRadius: '12px', border: '1px solid #dcfce7' }}>
              <h4 style={{ color: '#14532d', marginBottom: '10px' }}>Administrative Burden</h4>
              <p style={{ fontSize: '0.9rem', color: '#14532d', margin: 0, lineHeight: 1.5 }}>
                Multiple studies identify complex enrollment processes, prior authorization requirements, 
                and documentation demands as significant barriers.
              </p>
            </div>

            <div style={{ background: '#fffbeb', padding: '20px', borderRadius: '12px', border: '1px solid #fde68a' }}>
              <h4 style={{ color: '#92400e', marginBottom: '10px' }}>Geographic Disparities</h4>
              <p style={{ fontSize: '0.9rem', color: '#92400e', margin: 0, lineHeight: 1.5 }}>
                Rural areas consistently show lower participation rates and greater vulnerability 
                to provider network instability across different study periods.
              </p>
            </div>
          </div>
        </ThemeSection>
      </LiteratureSection>

      <LiteratureSection
        initial={{ opacity: 0, y: 50 }}
        animate={{ opacity: 1, y: 0 }}
        transition={{ duration: 0.6, delay: 0.3 }}
      >
        <SectionHeader>üéØ Novel Contributions</SectionHeader>

        <div style={{ marginBottom: '25px' }}>
          <h4 style={{ color: '#1e3a8a', marginBottom: '15px' }}>Methodological Innovations</h4>
          <div style={{ display: 'grid', gap: '15px' }}>
            <div style={{ padding: '15px', background: '#f8fafc', borderRadius: '10px', borderLeft: '3px solid #3b82f6' }}>
              <strong>Longitudinal Volatility Framework:</strong> First large-scale study to quantify 
              provider participation volatility using systematic threshold-based categorization over 
              extended time period.
